/// Gets the set of relative paths of block states that match the specified version range,
/// i.e., are read by at least a single game version in the range. `None` is returned if
/// the version range did not match any known Minecraft version.
pub(super) fn matching_for_version_range(
	range: &impl RangeBounds<MinecraftVersion>
) -> Option<AHashSet<RelativePath<'static>>> {
	let mut matching_assets = None;

	for (version_start_bound, version_end_bound, end_bound_is_inclusive, assets) in BLOCKSTATES {
		let range_matches = if end_bound_is_inclusive {
			(version_start_bound..=version_end_bound).intersects(range)
		} else {
			(version_start_bound..version_end_bound).intersects(range)
		};

		if range_matches {
			let matching_assets =
				matching_assets.get_or_insert_with(|| AHashSet::with_capacity(assets.len() * 2));

			for asset in assets {
				matching_assets.insert(asset.as_deref());
				matching_assets.insert(asset.with_comment_extension_suffix());
			}
		}
	}

	matching_assets
}
